R["oh__@talyn_rhaed"]="{['TS']=1727314788,['Version']=1773,['Key']='oh__@talyn_rhaed',['na']={[89]={['C']=1.026000,['O']=19810,['N']='Blackwood Chapel',['D']='In keeping with the posted backstory, this is a reclaimed ruin.  Particularly as regards the chapel which I\\'ve repurposed to my first portal hub, this has become one of the central hubs in my \"empire\", decicated primarily to personal affairs.  A minor manufuacturing hub.  Turns out I\\'m a builder.  Sauna, bathroom, lord and lady suite, library, trophy room upsairs.  Chamberlain and Lady in Waiting offices on the stairs.  All crafting stations.  And a BANGIN\\' kitchen and office on the main floor.',},[91]={['C']=1.042000,['O']=19810,['N']='Aqueduct Villa',['D']='Still thinking.  So far, although all the crafting stations and portal hub are present, this is a resort.  I have not repurposed the house to a hotel; I may not.  The back 40 is dedicated to leisure, dining and getting away .  I tend to model some of my stuff after the resorts I visit as a diver.  The cistern is now the pool area.  I\\'ve yet to build the swim up bar as I did at Dawnlight  (one of the greasted inventions ever) but soon.  If anyone has ideas...love to hear.  It\\'s only half done.',},[83]={['N']='Markarth Manor',['O']=19992,},[57]={['C']=1.025000,['O']=19809,['N']='Abah\\'s Landing Manor',['D']='Loosely themed after the ancient Library of Alexandria.  Exterior: Shipping and commerce at the docks with a major build for a portal hall to the right.  Manufacturing (all stations), administrative hub and leisure in the centre concourse.  Interior: Main Hall-Stage/Theatre, commissary, map room and extensive library / research ',},[101]={['C']=1.021000,['O']=19810,['N']='Necrom City House',['D']='First house I did on my own.  I had this greenhouse I wanted to use, and...lost Mayan City in the courtyard.  First attempt at EHT / Effects / Portals.  I\\'ve come to see my houses as outposts in some ancient trade empire.  This one is a private residence linked to my others through the one portal to Pantherfang.',},[41]={['C']=1.021000,['O']=19810,['N']='Craglorn Estate',['D']='Can\\'t remember...first home I think.  And I didn\\'t really do much of  the work.  I had the skill of a master crafter and houser helping me.  No effects yet but feel free to wander around.  Pretty cool place...and of course, use  the crafting stations at your leisure.',},[103]={['N']='Alik\\'r Oasis',['O']=19875,},},}"
