R["oh__@bitsqueezer"]="{['eu']={[48]={['O']=19958,['N']='Secret Dark Magic',['D']='Something strange has happened here...\\nYou\\'ll find a lonely Ogrim at a graveyard waiting to fight with you and add another visitor to grave reserved for...you!?\\n\\nBurned trees warns all who walks further that some really hot magic has turned this place into a horrrrrror house. \\nBeasts are there to take their breakfast from incautious visitors...\\nA skull can talk to you... \\nHidden cats found a place for love - but in the house there is a secret!...can you find it?',['C']=1.023000,},[9]={['O']=19964,['N']='Meridia\\'s Temple',['D']='A little Meridia temple in the garden, several big statues, a place for kings and queens.\\nFrom time to time it gets more items...',['C']=1.037000,},[70]={['O']=19958,['N']='Chillzone',['D']='Chill house - it has a second floor in the main hall with hidden access to a living room and a bedroom where Pirharri lives.\\nIf you want to be an ape...search around, you will be transformed, if you find it.\\nThe house has three outdoor zones, the right with a temple and a hidden chill zone, the left with a guest home and a western style chill zone, the middle with a walk to a great (and usually hidden) view.',['C']=1.022000,},[25]={['O']=19964,['N']='Birthday Partyhouse',['D']='You have birthday? Just invite some friends to this house to celebrate the birthday with cake and \"Happy Birthday\" written on the wall (no EHT needed to see it).',['C']=1.022000,},[14]={['O']=19963,['N']='All Of Light',['D']='Whenever you need to bath your soul in all the light this is the place to chill...',['C']=1.020000,},[81]={['O']=19106,['N']='Hjaalmarsch-Galerie',['D']='Chill zone for Bastian and dreamland for Phedre to catalog the items the chars are placing here..\\nHas a small fighting dummy with funny comments and an additional third floor with a good and bad altar.\\nHas all standard crafting tables and outfit table and also a transmutation station and arsenal corner.',['C']=1.030000,},},['Version']=1773,['TS']=1724971044,['Key']='oh__@bitsqueezer',}"
