R["oh__@silverstar1610"]="{['Key']='oh__@silverstar1610',['Version']=1773,['TS']=1721657626,['eu']={[28]={['N']='Goldberry Grove',['C']=1.024000,['D']='A small cosy inn in the wilds of the Rift. Come in, out of the cold and the wind. There\\'s ale and food, and a roaring fire to warm yourself by, while you listen to tales of adventure and exploration from the innkeep. ',['O']=19856,},[49]={['D']='In the middle of the swamp, you come across a small cottage hidden away behind high walls, protecting it from the dangers beyond. The tiny grove is planted with herbs and plants from far and wide, and the scent of flowers wafts on the breeze, enticing you in. From the potions and cures being brewed, it seems to belong to a herbalist, currently absent, but the nixads left in charge are doing a fine job of keeping watch. And causing trouble ... ',['C']=1.020000,['N']='Herbal Hideaway',['O']=19926,},[63]={['N']='Snowdrift Cottage',['C']=1.036000,['D']='Just a small cosy home to escape to to see in the season. \\n\\nCurl up in a chair by the roaring fire with a mug of cocoa, help yourself to the food laid out in the dining room, or take a nap in the warm bed downstairs. \\n\\n(*in progress*)',['O']=19496,},},}"
