R["oh__@leopardwolf"]="{['Version']=1773,['Key']='oh__@leopardwolf',['TS']=1720480838,['na']={[3]={['N']='Ebonheart Inn',['D']='When you lie to the landlord about not worshipping Daedra, only to proceed to worship Daedra within the premises anyway. Blood stains and cobble floors go well together, afterall. You have to make good use of the smallest spaces, when it is all you have to work with.',['C']=1.002000,['O']=19491,},[61]={['N']='Werewolf Den',['D']='This hauntingly attractive retreat awaits you. You never know what you might find lurking. The neighbors are mostly quiet.  Watch your step if you decide to explore the caves. You might get lost and never find your way out. --Note: Follow the purple paths. Fun details are hidden throughout.',['C']=1.038000,['O']=19660,},[106]={['N']='Apocrypha Tower',['D']='A ritual shrine, to help you ask the fates and RNG Deities for their blessings.\\r\\n- - -\\r\\nUsing 1st person view is recommended upon entering, for best viewing. ',['C']=1.023000,['O']=19912,},[7]={['N']='Black Vine House',['D']='A \"scholarly\" vacation retreat with a garden. Invite some friends to come along. Good food and good company! Catch up on some reading, rest, and relaxation after your adventures. Enjoy the view of the river and waterfall from the viewing platform.',['C']=1.051000,['O']=19560,},},}"
