R["oh__@robertjfcalais"]="{['eu']={[68]={['O']=19885,['N']='Flikko-dar\\'s Retreat',['D']='Home of a traveling Khajiit and his Alfiq companions.\\n\\nThe stained glass window casts a gorgeous scene onto the bed and adjacent wall. You might need a powerful PC and high graphics settings for the scene to be visible.',['C']=1.051000,},[2]={['O']=19861,['N']='Daggerfall Inn',['D']='This is merely a recreation of the room shown on the loading screen, down to as many details as possible.',['C']=1.051000,},[18]={['O']=19892,['N']='Calais Manor',['C']=1.021000,['D']='This is Calais Manor, home to a traveling Breton alchemist.\\r\\nThe homeowner furnished most of the rooms in styles of regions he especially enjoyed visiting, namely Alik\\'r, Blackwood, Elsweyr, High Isle, Summerset and West Weald.\\r\\n\\r\\nUpon entering the manor, you\\'ll be introduced to the housekeeper, Nuzhimeh, already expecting you coming home from your travels. The dinner table is set, meals are already on the fire, all the candles and lamps are lit, the bath is prepared and the beds are made.',},[62]={['O']=19860,['N']='Mystic Knights Manor',['D']='Coming in with a spacious garden, a grand lobby, extravagant gallery and expansive library, this luxurious guild hall has everything to ensure our visitors a quality time during their stay.\\nThe north suite houses the kitchen and spacious bathroom and the guild master\\'s quarters are inside the south suite.\\nThe guild\\'s advisors meet up at the round table inside the library and a grand monument is being built inside the manor\\'s crypt in memory of a fallen officer.\\n\\nStill a work in progress.',['C']=1.021000,},},['Version']=1773,['TS']=1718714832,['Key']='oh__@robertjfcalais',}"
