R["oh__@kiragna-foure"]="{['Key']='oh__@kiragna-foure',['Version']=1773,['na']={[64]={['D']='Nothing says \\'Party House\\' like one ina swamp. Where else can you drink yourself into oblivion while rambling about a dank, dark stone edifice surrounded by humidity, mud and hordes of mosquitos? Then there is the camping. Did we mention the plants? No? Forget we said anything ....',['N']='Frogmire',['O']=19852,['C']=1.031000,},[71]={['D']='What could be safer than setting up your tents just on the outskirts of an old graveyard?  There is a backwater bar right down the road and not a ghost in sight. Unlike the wares of this pair of merchants not everything in this meadow is obvious to the eye,until you go hunting for it..',['N']='Moon-Sugar Market',['O']=19284,['C']=1.031000,},[44]={['D']='There is nothing quite like a little seaside cottage built inside the remains of a bug. Nothing at all. Leaves a person speechless. Well if \"bug living\" is for you, pay us a visit.  We do kindly ask you not to spray the premises.',['N']='Parasols',['O']=19287,['C']=1.018000,},[73]={['D']='Yes, it is on the coast. Beautiful view of the water from the spacious courtyard. A lovely home to relax in after a hard day of mayhem and destruction.',['N']='Senchal House',['O']=19284,['C']=1.018000,},[60]={['D']='If you have ever wanted to go to the beach but didnt want a sunburn, this is the place for you. We have a trading post, camp sites and a cozy little taven, The Green Mermaid.  So drop anchor and stop in, have an ale and feel the sand between your toes.',['N']='Green Mermaid Bar',['O']=19859,['C']=1.018000,},[103]={['D']='Nothing like a cold ale in a dusty bar  on a hot day. This place is a crossroad town of traveling salesmen who would probably sell you your mother..',['N']='House of Blue Djinn',['O']=19848,['C']=1.041000,},[40]={['D']='Nothing like a secluded island get away with all the amenities of home. Acres of sun drenched sand complete with a rustic beach bar, a cozy bungalow, swimming, fishing, why there is even a rumor of hidden treasure. Dont like the sun? Prefer moonlit night walks? We can accomodate that as well. If you wish to sacrifice to the volcano god we ask that you bring your own virgins. We supply plenty of rum and atmosphere, but not vigins.',['N']='Kamiodoriji No Ro',['O']=19294,['C']=1.018000,},[41]={['D']='Ever wanted to go camping without actually going out and sitting in the woods? Here you can be outdoors without being outdoors. No getting wet or being struck by lightning if the weather goes sour. At least no one has yet, gotten struck by lightning. Hopefully.',['N']='Scowl\\'s Hollow',['O']=19280,['C']=1.021000,},[79]={['D']='This is just the place for you, if you are one of those people who don\\'t seem to be able to make it out during the day anymore. Need a place to nap, there are so many box..err beds to chose from, take your pick. Just dont pick the one upstairs. It\\'s occupied. Oh, and please remember to dine before your visit. The servants are strictly off limits since it is quite difficult finding reliable help these days.',['N']='Nightshade Hall',['O']=19276,['C']=1.038000,},[75]={['D']='This backwater trading post boasts a rustic inn, a bath house (2 tubs!) and, uh, well they dont really boast about the crazy mage up the hill. They prefer to ignore him.',['N']='Bookman\\'s Corner',['O']=19845,['C']=1.018000,},[76]={['D']='Yes, the streets seem largely deserted, but can you be sure?  There is that feeling, that sly eyes are  watching intently. Watching you, your purse and the camel you rode in on.  Hey, camels are worth a lot of money...',['N']='Rook',['O']=19845,['C']=1.041000,},[43]={['D']='Nothing like relaxing in a cozy country home complete with an upstairs bar. Dont get drunk and waltz around on the promanade, unless you want a quick trip to the ground.',['N']='The Speakeasy',['O']=19845,['C']=1.021000,},[46]={['D']='Want to get away from the city for a weekend in the counrty without going totally rustic. There will be no picking the hay out of your hair here, unless you just like to roll in..nevermind...',['N']='Whitecrow House',['O']=19865,['C']=1.021000,},[47]={['D']='If you cant find a cave on your property to live in, just build one. This little split level/ranch style cave is just the place for cozy living..if Coldharbor can ever be called ..cozy.',['N']='Coldharbour Oasis',['O']=19280,['C']=1.021000,},[32]={['D']='It\\'s all about the foundation that a house is built on. Some are solid, like the very rocks of the earth. Others are riddled with holes like a wormy apple. I, of course, blame it on the chickens for not eating the worms in the first place. ',['N']='Silent Requiem',['O']=19276,['C']=1.038000,},[17]={['D']='Quiet village living, nothing beats it. Puttering around the garden during your down time..and somebody has done some serious puttering. So, grab a cold one and kick back. Take time to smell the flowers.',['N']='Fell\\'s Run House',['O']=19856,['C']=1.031000,},[82]={['D']='Relaxing in a pocket realm is so relaxing. While important safety features have been installed, management will not be responsible for any \\'accidental falls\\'. The place is floating over a void. You have been warned.',['N']='\"Starshine Point\"',['O']=19430,['C']=1.007000,},[56]={['D']='Well, yes, there certainly is a garden with a rather breath taking view. There are also a few cobwebs and a crypt. The owner certainly considers this large hole in the ground to be an estate, or maybe just a good place for lying in state',['N']='Nightgarden',['O']=19276,['C']=1.021000,},[20]={['D']='Keep your friends close and your enemies closer..Well, isnt that what basements and backyards are for? This place? Oh it\\'s just the modest village home of a modest village Dunmer.',['N']='Dracsolaris House',['O']=19864,['C']=1.047000,},[81]={['D']='This is where homeless statues go to not be homeless anymore. Grab an ale at the bar and have a relaxing walk about the grounds and hall. Most things here are quite obviously on display but some are hidden. Isn\\'t the finding half the fun?',['N']='Notwendige Dinge',['O']=19311,['C']=1.030000,},[22]={['D']='While it may be small, it is opulent. Or at least very cluttered.',['N']='Laughing Moons House',['O']=19851,['C']=1.018000,},[23]={['D']='Just a little cafe on the outskirts of town.  Nothing like tea, sweetrolls and maybe a skewer or two of grilled lizard on a lazy afternoon.  No on the grilled lizards? Well the menu does have other items.',['N']='The Green Cat Grill',['O']=19293,['C']=1.021000,},[88]={['D']='Welcome to the Tipsy Nix, a cozy little Inn that shares a building and a balcony garden with the home of an arcane arts dabbler. The whole set up makes you wonder just who is renting from whom.',['N']='The Tipsy Nix ',['O']=19869,['C']=1.051000,},[49]={['D']='Ah, its that time of year again when the bones rattle and chill winds blow. Nothing like a nip or two at your local bog-side tavern to take the icy edge off a fall evening. Just dont drink yourself into insensibility. people have been known to ..disappear.',['N']='Hedgewizard\\'s Tavern',['O']=19276,['C']=1.038000,},[18]={['D']='It isnt clear exactly what \\'traditions\\' are being showcased here. This is appears to be the abode of one who has brought home one too many conversation pieces from their travels abroad. .....crazy Breton...',['N']='Heaven\\'s Scents',['O']=19853,['C']=1.051000,},[59]={['D']='Yes , everyone needs a place where you can bring your High Elf friends and not have them turn their noses up at it. Wait, their noses are always turned up...',['N']='Witcrow Hall',['O']=19846,['C']=1.500000,},[28]={['D']='There you go, innocently walking through what you thought was a garden gate and ending up in a tucked away pocket of Oblivion. Even a Daedra is entitled to a cozy cottage to do whatever it is they do in and around cozy cottages. Gardening perhaps?',['N']='Nimalten House',['O']=19864,['C']=1.043000,},[61]={['D']='Ever gone out drinking at some dive bar, popped out back for a whizz behind a tree and gotten lost in the woods? Lost in the woods where wolves are roaming around? And the wolves kind of smile at you? Ever wonder why the only snacks back at that bar you wish you never left were chunks of undercooked meat? Ever woke up the next morning smelling like wet dog and wondering just when hair started growing on your ears? Never? Well here\\'s your chance....',['N']='Smoking Orc Bar',['O']=19276,['C']=1.038000,},[30]={['D']='Caught somewhere between rustic and eclectic this home is still a cozy retreat on the outskirts of town.',['N']='Gold Oaks',['O']=19855,['C']=1.047000,},[107]={['D']='An out of the way Inn located on a lovely lake. Perfect for a day trip, or a week in the country away from the bustle of city life.',['N']='O\\'Hermie\\'s Inn',['O']=19840,['C']=1.047000,},},['TS']=1716740760,}"
