000,['O']=19009,},[87]={['N']='Shrine to Thor',['D']='Made for the Homebodies History challenge, this is a temple to the norse god Thor (with MCU aesthetics for fun). ',['C']=1.037000,['O']=19428,},[24]={['N']='Monastery',['O']=18735,},[73]={['N']='Zavusha\\'s Imports',['O']=18735,},[58]={['N']='Alinor Inn',['D']='\"(Lie) I certainly don\\'t worship any daedra!\"',['C']=1.007000,['O']=19852,},[91]={['N']='Elsweyr summer house',['D']='An elsweyr styled house for my characters.',['C']=1.026000,['O']=19844,},[59]={['N']='Temple to Sanguine',['D']='A temple dedicated to Sanguine. Slightly NSFW. ',['C']=1.037000,['O']=19121,},[68]={['N']='Rimmen Inn',['D']='Bank of Ezabi',['C']=1.002000,['O']=19212,},[62]={['N']='Calinwe Spa Resort',['O']=18735,},[100]={['N']='Necrom Inn',['D']='(Lie) I don\\'t even worship daedra! ',['C']=1.007000,['O']=19826,},},['Version']=1773,}"
