R["oh__@seminolegirl1992"]="{['TS']=1697485829,['na']={[48]={['D']='Welcome to Elysium, an idyllic goodly plane of nature where the platinum dragon druidic goddess Taiga and her husband reside with their draconic children. Features a shrine to many gods they pay respect to, a forge her husband loves, their home, and a town not far away where  many of her friends and family live. Set in the Forgotten Realms campaign setting for D&D. ',['N']='Taiga\\'s Realm',['O']=19065,['C']=1.020000,},[33]={['D']='A forested estate owned by an aasimar couple located in Elmaseranine, where they raise their triplets and dryad child. They display their relics found whilst adventuring in ancient elven ruins, enjoy a sauna, balcony view of the forest, and aquarium.',['N']='Hikova Estate',['O']=19199,['C']=1.021000,},[2]={['D']='Interior of a spacious khajiiti caravan. Comfortable cushions seat four. Plenty of room for storage and two bedrolls.',['N']='Khajiiti Caravan',['O']=18820,['C']=1.007000,},[99]={['D']='Welcome aboard the Sorceress Serenade, a cruise ship run by a copper half-dragon sorceress and her crew. Features include an above deck pool, live stage, movie theatre, bar, and telescopes for viewing the beautiful night sky! The cabin area hosts an aquarium, library, and buffet diner. Head below deck for a nightlife experience with our dance floor, club, dj, and bar. Enjoy your stay!\\n\\nOpen to rp, thanks all for coming to visit!',['N']='Sorceress Serenade',['O']=19638,['C']=1.007000,},[68]={['D']='Located in the heart of Rimmen, come enjoy this private suite across the Sugar Bowl Inn! Features a queen sized bed, hot bath, sitting area, wardrobe, and nightstands. Complimentary wine provided. ',['N']='Crescent Inn',['O']=18821,['C']=1.007000,},[15]={['D']='The Intelligence Branch are a series of offices dedicated to Elmaseranine\\'s spy network, where they craft alchemical potions, poisons, send rogues on missions, and most importantly, provide intelligence as part of the king\\'s council to ensure the city is kept safe. Elmaseranine is an elven city set in Faerun as part of our DnD campaign. Feel free to use for RP, and thanks for coming by!',['N']='Intelligence Branch',['O']=19199,['C']=1.007000,},[17]={['D']='A home belonging to a copper half-dragon follower of Bahamut and Corellon. Rynne works as a spy for the elven kingdom Elmaseranine, hence the portal, bounty sheets, and books on various cultures. She planted a beautiful garden in her courtyard and enjoys a quiet lifestyle in the small town of Daggerford. ',['N']='Rynne\\'s Home',['O']=18819,['C']=1.021000,},[71]={['D']='Nestled deep within the High Forest of Faerun, the six-story Galanodel Tree is the center of the elven metropolis Elmaseranine and home of the royal family. Come visit the throne and request an audience with the benevolent king!',['N']='Galanodel Tree',['O']=18940,['C']=1.021000,},[36]={['D']='A quiet and romantic beach estate owned by a breton mage couple and their young son. Features an indoor garden, teleportation circle, hot tub, private getaway, tower, garden venue, and rooftop entertainment area.',['N']='Mecoud Palace',['O']=18890,['C']=1.021000,},[19]={['D']='A war room beneath the throne room of the sun elven kingdom of Elmaseranine, located in the High Forest. Ruled by a kind paladin, Levayne Galonodel. The transmute station represents an ancient, powerful scrying device. ',['N']='Mythal War Room',['O']=18819,['C']=1.007000,},[87]={['D']='Visiting Leyawiin? Enjoy a cozy suite in Kaladas Inn! Two beds, large wardrobe, and sitting area. Complimentary wine and chocolates provided.',['N']='Kaladas Suite',['O']=18821,['C']=1.007000,},[59]={['D']='This gorgeous 3-story Alinor home features 3 bedrooms (master has its own study), a large bathroom, aquarium, lounge, cozy kitchen/dining room, and a garden courtyard perfect for entertaining guests. A stairway leads to an upper garden, where you can relax on the hammock enjoying a good book and a beautiful view. ',['N']='Summerhome',['O']=18821,['C']=1.021000,},[18]={['D']='A magic items shop owned by a breton couple, filled with alchemical items, enchantment components, various magical artifacts, books, and more. Features weapons and armor crafted by her husband. Outdoor garden and waterfall.',['N']='Mystical Marvels',['O']=18819,['C']=1.041000,},[45]={['D']='This tree home belongs to the renowned moon elf ranger Vilyo Caemendir and his family. It was gifted to him by Solonor Thelandira, the elven god of archery, for his service to the Realms. Taken from part of The Pale Tree itself, this home is an elysian reminder of his time serving by the god\\'s side.\\n\\nSet in Forgotten Realms campaign. Open to rp. ',['N']='The Pale Branch',['O']=19645,['C']=1.007000,},[62]={['D']='Located in the center of Arvandor, this palace is the home of the elven god and leader of the Seldarine, Corellon Larethian. It is a magical place where celestials and souls of fallen elves frollick and enjoy the afterlife.\\n\\nReupload due to several aesthetic changes and improvements. Feel free to use for rp. ',['N']='Crescent Grove',['O']=19376,['C']=1.007000,},[79]={['D']='Belonging to House Baenre, this compound of powerful noble drow is situated in Menzoberranzan, a city in the Underdark. Features an intimidating temple to the cruel spider queen Lolth, the malicious cleric Sos\\'Umptu\\'s bedroom, and her son Nym Baenre\\'s bedroom. Nym, imprisoned and tortured by his own family for abandoning Lolth and their ways, eventually escapes to the surface to begin a new life, following the good and humble creator of the elves, Corellon Larethian, Lolth\\'s most hated enemy. ',['N']='House Baenre',['O']=18819,['C']=1.043000,},},['Version']=1773,['Key']='oh__@seminolegirl1992',}"
