motes and raids,\\nA mother\\'s love never fades.\\nShe\\'s the cheerleader, the supporter, the unseen beam,\\nFueling the spirit of the dreamer who streams.\\n\\nFor every Khajiit\\'s leap, every Nord\\'s shout,\\nThere\\'s a mother behind the scenes, without a doubt.\\nSharing in victories, comforting in defeats,\\nHer love transcending digital feats.\\n\\nSo here�s to the mothers, in streams far and wide,\\nWho stand by their gamers, forever allied.\\nFor in the Elder Scrolls saga, so vast and profound,\\nIt\\'s a mother\\'s love that truly knows no bound.',},['Y']=27138,},[14]={['X']=121452.870379,['EffectType']=8503,['Alpha']=1,['Id']=1097,['Color']=991835,['SizeZ']=50,['Z']=102279.288755,['Roll']=0,['Groups']=0,['Pitch']=4.712564,['SizeX']=29.456456,['Contrast']=1,['SizeY']=50,['Yaw']=3.878122,['MetaData']={['title']='Neliserendipity',['message']='Dear Neli  firstly Ty for your service to your country .\\n     Neli, ty for all that you bring to eso and the whole world wide comunity and from all of us we all ty for your wonderfull stream that you bring to us and the whole comunity all over this world  ,yes your world wide famous for all the goodness you share and fun you bring.\\n    I noramly say we cant help every one but everyone can help someone ,but you ,you  help every opne world wide  each time you stream you help all to laught, smile, feel happy,entertain us, and enjoy eso streams that you bring to us, it dosent take riches or be a world famous star to give what you give to so many for this, this makes you super sepcial and respected and love but thousends of us world wide so ty Neli xx\\n\\nYour friend Nomak x\\n     ',},['Y']=27131,},},['Version']=1773,}"
