R["oh__@jarogniewa"]="{['eu']={[1]={['D']='That was first place where he gets after leaving home. Auridon. Altmer culture and art! What a splendid place! But he needed to find way to live. He decided to trade slaves. Khajiits and Argonians servants. First he needed to know his competitors, so he visited few slave sellers. He will never forget last one...\\r\\n- Young and fine, my lord! You can try before buying,we have bed here,or buy and use on place, if you wanna one time toy.\\r\\nAll those tools to couse pain and death... He just killed him.',['C']=1.028000,['O']=19109,['N']='Vulkhel Guard Inn',},[2]={['D']='Count of Leyawiin started to be suspicious after three of his wine testers dies in horrible pain in just one week so he decided to put Kerlen on a mission. It is strange to use your assistant as a spy, but it was open secret, who was he suspected. Kerlen was acting like it would be an amaizing honor, he ordered furnishings for his Daggefall hideout and moved as fast as it was possible. He knew he will need to disappear before Count will gain confidence about Kerlens fault and order to kill him.',['C']=1.049000,['O']=19084,['N']='Daggerfall Inn',},[3]={['D']='Khazad gro-Igrun is an orcish headhunter working on Ebonheart Pact terrain. After few years of hard work he decided that just renting a room in a tavern and not having a things for him own is not a life, so he bought a room and decided to furnish it. He is missing Wrothgar, but building again whole network of contacts and informers from nothing is for him not worh moving back to homeland.',['C']=1.049000,['O']=19084,['N']='Ebonheart Inn',},[48]={['D']='Most expensive house to hold 2 most valuable things - knowledge and friends who teached me everything.\\n- Let\\'s buy that house and pay some orcs to fix it quick, it got to be ready for wedding. - that was his last mistake. Why not ask questions? Like why nobody wanna live there? Maybe is becouse of those the ruins near it? Maybe noone wanna get close to it couse of stories about caravans that was traveling next to it and vanished?\\nThose who do not know history are doomed to repeat it.',['C']=1.023000,['O']=19028,['N']='Falkreath Hall',},[81]={['D']='Please, visit at night.\\nIt was so peaceful for a while... This region was a center of war between orcs and men for centuries. We all get tired of it so both sides decided to put border on the river. And then nirncrux have been found on our lands, but we wasn\\'t experts in grinding it, so we started to cooperate with orcs. After grinding we was selling it, but our jarl was to greedy. Orcs was jelous for how much we was making on their work, and here we are now, surrounded, cornered, ready to die..',['C']=1.047000,['O']=19188,['N']='Hjaalmarch Gallery',},[15]={['D']='House got to be visited at night!\\r\\n\\r\\nYou finally found the Smurfs village! But where are all the Smurfs?! Where\\'s Papa Smurf and Smurfette? Oh no! Look next to the entrance! It\\'s Azrael! So Gargamel tooke them! Should you wait or look for them? Well, I guess they always manage, so lets see their world before they will come back!',['C']=1.020000,['O']=19174,['N']='Cormount House',},[87]={['D']='It was just after he left his step father house. He run from Vvardenfell and moved to the south. First he though he will be hunting slaves there to make some easy cash. But when he geted to Leyawiin he looked higher than swamps and slaves level. Castle towers was stabbing heavy clouds.\\r\\n- I\\'m gonna rule there some day. - he said. - No metter what it will cost.\\r\\nAfter that he rent the appartment and started work as a Counts assistant waiting for the right moment to pour some poison to his wine...',['C']=1.051000,['O']=19083,['N']='Leyawiin Inn',},[68]={['D']='Trinity is a humble khajiit sellsword. She have worked with many merchants caravans. As she don\\'t have time now for starting a family, she decided just to rent a small apartment for her own.',['C']=1.051000,['O']=19084,['N']='Rimmen Inn',},[5]={['D']='When you ask Nuzhineh who is she, then you will hear that she\\'s just a humble traveling merchant, but quick glance into her apartment is saying much more. She rented small place like this not to conspisious, but all that gold, expensive furnishings and handmaded carpets was shouting \"smuggler\". And yes, she is a smuggler, and damn good one! She have her own ship and she can get you whatever you need if you know how to find her...',['C']=1.051000,['O']=19084,['N']='Sentinel Apartment',},[70]={['D']='You get lost in woods, it was getting dark, so you looked for a place to rest. You saw entrance to a cave and it looked like there is some light coming out from it. Maybe that is some other lost traveler? Maybe a merchants caravan stoped in here? Worth to check... Oh no! That is another magical cavern. Lets see where it can take us. If we are lucky it will take us to some civilized place...',['C']=1.031000,['N']='Rimmen Temple',['O']=19353,},[39]={['D']='This is my main character estate. He is a Dunmer assassin and poisoner , who loves only 2 things - power and money, no matter what it takes to get those. He have this big house with slaves and lot of expensive items just to show his status to guests. He also thinks that there is just one race better than his own - Altmers. He likes their style, that is why you can find this house as a mix of both Dunmers and Altmers culture.',['C']=1.021000,['O']=19082,['N']='Ebonheart Manor',},[42]={['D']='Time stopped in here. At least for him. This is how he remembered his stepfather\\'s house. This is how it looked the day he discovered, that this is not his real father. He confronted man he used to love. And what he geted? Story that showed his father as a scoundrel and short informacion how he had been killed by the same person who was telling him that, slowly and without any emotions. Then he lefted this place forever and never looked back.',['C']=1.051000,['O']=19084,['N']='Vivec City Inn',},[90]={['D']='This is my protest-house. Just like protest-songs is my artistic way to show my feelings. Is not maded to slander any religion or to offend normal people but to show my disgust about certian action of catholic church in my country as they are trying to rule it, grab goods and protect pedophile priests. If this is how church should act, then its place is in hell.',['C']=1.500000,['O']=19082,['N']='Deadlands Plot',},[58]={['D']='- Why don\\'t you buy a bigger house, Taladrielle. Is not that you can\\'t afford it.\\r\\n- Well, I don\\'t spend to much time in it, so this one is just enough to contain me, my studies and my work, sister.\\r\\n- But what about life, husband, children..\\r\\n- Being a Sapiarch is not just a magickal nonsense, like your absurdous healer work, Illumielle! Is a duty and a great honor. I have no time to waste for other people!',['C']=1.020000,['O']=19083,['N']='Alinor Inn',},[59]={['D']='Welcome to an Alinor History and Art Museum. Our museum have been created in a house of well known philanthropist - Illumielle Lillem by herself and gave to the city. Illumielle lives in this house on last floor, the other two floors are full of astonishing exhibits from the donors collection gained during her long travels to every corner of the world. But don\\'t waste more of your time, buy a ticket and start your jurney to the farest parts of Tamriel.',['C']=1.030000,['O']=19104,['N']='Alinor House',},[10]={['D']='Many thanks to Slipstiched_Magpie for making Bantam Guars weddings so popular! This is my own version of it.\\n\\nA magical castle hidden in a pile of mud. Meet King guar, his wife-to-be and their future offspring. Drink some water, eat some worms and let yourself witness magic of love.',['C']=1.020000,['O']=19125,['N']='Dhalmora House',},[77]={['D']='Gorm should have known that keeping goat in a bed means lot of small, brown beans... But where they came from? Is it a gift from a happy goat? Maybe is like eggs from chicken? Gorm need to try make a drink from it. Or dinner!',['C']=1.051000,['O']=19084,['N']='Solitude Inn',},[49]={['D']='They say, that a witch lives there, on the swamps. Some time ago house was raided by knights and exorcised by priests, but in the night you can hear screams howling through the wetlands. Some people say that its witches soul, some other says that the witch came back... You dare to go there and find it out for yourself?',['C']=1.023000,['O']=19083,['N']='Witches Hut',},[95]={['D']='Konnichiwa! Just a Japanese style bedroom. Continue scrolling.',['C']=1.049000,['O']=19353,['N']='Gonfalon Bay Inn',},},['Key']='oh__@jarogniewa',['na']={[87]={['D']='Old MacDonald had a farm, E-I-E-I-O.\\r\\nAnd on that farm he had a cow, E-I-E-I-O.\\r\\nWith a moo moo here and a moo moo there\\r\\nHere a moo, there a moo, everywhere a moo moo\\r\\nOld MacDonald had a farm, E-I-E-I-O.',['C']=1.047000,['O']=19039,['N']='Leyawiin Inn',},},['Version']=1771,['TS']=1672103332,}"
