R["oh__@werewallaby"]="{['na']={[32]={['D']='Large two-story cubic modern house with a focus on simplicity and openness. The first floor is decorated as a garden/guest bedroom. The second floor features the main living space with a view to the lake and a sunken ship outside. ',['C']=1.050000,['O']=19191,['N']='Northern Retreat',},[17]={['D']='Exterior stone/wooden house with large windows overlooking the town square. Oversized balcony on the other side with panoramic view of snow capped mountains in the distance.',['C']=1.041000,['O']=19179,['N']='A Room with a View',},[34]={['D']='Custom-built modern Ikea style desert house with minimalist furnishing and a large rooftop garden with grand view of the city nearby. The use of limestone as the main construction material is inspired by serveral wonderful houses done by @oakberry.',['C']=1.046000,['O']=19184,['N']='White Stone Rest',},[36]={['D']='Oceanview rooftop apartment with a New Orleans style courtyard.',['C']=1.046000,['O']=19212,['N']='Rooftop Apartment',},[23]={['D']='Small family home with a candle-lit wading pool.',['C']=1.014000,['O']=19222,['N']='Country House',},[70]={['D']='Bathhouse, Waterfall Pool, Hanging Garden, Lake Home. ',['C']=1.014000,['O']=19160,['N']='Hanging Garden Baths',},[7]={['D']='A home in the enchanted forest. Interior decorated as a meadow under the trees. Exterior yard contains a tree house that provides a view of the waterfall and the lake outside.',['C']=1.020000,['O']=19182,['N']='Enchanted Forest',},[28]={['D']='Cozy nordic house with large windows and a lake view.',['C']=1.047000,['O']=19181,['N']='Lake View Cottage',},[25]={['D']='A lantern festival in the garden of a small family home.',['C']=1.021000,['O']=19226,['N']='Lantern House',},[26]={['D']='A cozy Victorian/steampunk-themed San Francisco house with a high balcony. ',['C']=1.051000,['O']=19210,['N']='The Doll House',},[59]={['D']='Custom-built two-story townhouse on the terrace overlooking the city of Alinor.',['C']=1.021000,['O']=19231,['N']='Terrace Townhouse',},[44]={['D']='Exterior garden/tree house overlooking the ocean and harbor. An ideal property for those who enjoy tree-tunnels and summer outdoor living. ',['C']=1.035000,['O']=19179,['N']='Harbor Tree House',},[10]={['D']='A tiny farmhouse in the backyard. ',['C']=1.047000,['O']=19216,['N']='Tiny Home',},[14]={['D']='Custom-built skydeck home that provides panoramic view of the surrounding forest.',['C']=1.051000,['O']=19196,['N']='Skydeck Home',},[11]={['D']='A small cottage with its back window facing the river. ',['C']=1.047000,['O']=19200,['N']='Riverway Cottage',},},['Key']='oh__@werewallaby',['TS']=1661584505,['Version']=1769,}"
