R["oh__@reecelavellan"]="{['Key']='oh__@reecelavellan',['eu']={[10]={['C']=1.031000,['D']='No Mud Humblemud - An Elder Argonion\\'s home.\\n\\nThis cosy home is inhabited by An Argonian Hermit mage who is very wise, but hates to be disturbed. He disguised his house as a spooky run down hut from the outside, but inside its nice and cosy!\\n\\nThis is a reupload of this home as it somehow got unpublished.',['N']='Elder Argonian Home',['O']=19216,},[25]={['C']=1.041000,['D']='Baandari Town street of culture\\r\\n\\r\\nDisaster has plagued every region in Tamriel, and refugees flee to wherever is safe to make a new home. Some such refugees have decided to settle in the Baandari trading post village. They banded together sharing resources, furniture and money to build new homes in this little side street. Lots of different styles have been mixed and matched, trying to make a home for themselves that brings a connection to where they were originally from to fight off homesickne',['N']='Street of Culture',['O']=19085,},[34]={['C']=1.035000,['D']='A lush garden home, thriving in the middle of the desert? A powerful servant of Yffre guards this veritable Eden and its inhabitants. Can you find her?',['N']='Eden',['O']=19214,},[62]={['C']=1.020000,['D']='My Psijic Mage\\'s home, with a penchant for clockwork. Filled with curios and souvenirs from his journeys and conquests throughout Nirn.',['N']='Psijic home of shit',['O']=19094,},},['Version']=1769,['TS']=1660338313,}"
