d wife\\n\\n   Don,t think of her as gone away, \\n   Her Journey has just begun\\n   Life holds many facets\\n   The Nirn is only one\\n   Just think of her as resting\\n   From the sorrows and the tears\\n   In a place of warmth and comfort\\n   Where there are no days or years\\n   Think how she must be wishing\\n   That we could know today\\n   How nothing but our sadness\\n   Can really pass away\\n   And think of her as living\\n   In the hearts of those she touched\\n   For nothing loved is ever lost-\\n   And she was loved so much.\\n\\n\\n                                               By Sitemius\\n\\n\\n\\n\\n\\n\\n\\n\\nOUT OF CHARACTER INFORMATION:\\n\\nThis was a character/player I roleplayed with my toon Sitemius. I have many long hours and months playing with this player. This toon was his wife for a time and I felt it was a good reason to keep the many great memories about it. But as with real life we all move on and so did the player. I keep this as a reminder to the how great the roleplay community can be in making ever lasting memories for the players.',},['Pitch']=5.148721,['Alpha']=1,['SizeY']=30,['Z']=74808.754587,['Color']=102439,['Contrast']=1,['EffectType']=8502,['Id']=1135,['Y']=21726,['SizeZ']=30,['Yaw']=4.712389,['Groups']=0,['Roll']=0,},[35]={['SizeX']=1,['X']=95350.922423,['MetaData']={['will be']='Off',['is']='On',['then group furniture']='4617253786397111401,4617253786397056771,4617253786397181947,4617253786397129309,4617253786397162972,4617253786397076701,4617253786396859833,4617253786396833038,4617253786396859834,4617253786396859835,4617253786396995440,4617253786397043847,4617253786397118747,4617253786396944369,4617253786397014555,4617253786397043693,4617253786397102403,4617253786396981931,4617253786397064451,4617253786396917498,4617253786397018183,4617253786396999276,4617253786397195920,4617253786397055019,4617253786397207767,4617253786397223261,4617253786396944393',['when furniture']='4617253786397223261',['then group']='MusicBoxe