R["oh__@agasaagasai"]="{['TS']=1626107549,['Version']=1747,['na']={[80]={['D']='Little known to the rest of Tamriel, the Potentates once ordered the construction of a heavily fortified castle in true Tsaesci style reminiscent of their home islands. It was intended for use as both a last refuge and a northern retreat away from the scorching Elsweyr heat. The sudden assassination of the last Potentate and his family, however, means that its ramparts remain untouched and rooms unfinished, for now. Welcome then, to this rare example of Akaviri fortification this side of Mundus.',['C']=1.017000,['O']=18820,['N']='Fubukiyama Castle',},},['Key']='oh__@agasaagasai',}"
